<style type="text/css">
	#sample2_1 {
 padding:20px 10px 0px 10px;
   background:#FFFFFF;
 width:100%;
 height:45px;
}
#sample2_1 .text {
 float:left;
 width:212px;
 height:30px;
 border:5px solid #CCC;
 border-radius:20px;
 text-indent:10px;
 margin-right:5px;

}
#sample2_1 .btn {
 float:left;
}

#sample2_1 input {
 float:left;
 height:30px;
 border:5px solid #CCC;
 text-indent:10px;
 margin-right:5px;
}
#sample2_1 select {
 float:left;
 height:40px;
 border:5px solid #CCC;
 text-indent:10px;
 margin-right:5px;
 background-color:#ccc;
 color:#fff;
}
#sample2_1 .text1 {
 width:210px;
}
#sample2_1 .text2 {
 width:150px;
}
#sample2_1 .text3 {
 margin-right:0;
 width:110px;
}
#sample2_1 .text4 {
 width:110px;
}
#sample2_1 .select1 {
 width:120px;
 text-indent:5px;
}
#sample2_1 .select2{
 width:120px;
 text-indent:5px;
}
#sample2_1 .text3 + span{
 display:block;
 width:30px;
 height:40px;
 line-height:40px;
 text-align:center;
 float:left;
}
#sample2_1 .btn {
 margin-right:0;
 width:115px;
 height:40px;
 float:left;
 border:none;
}


</style>


<div id="sample2_1" style="position:fixed; top:40; left:0;">



</div>

